INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 1, 62, "2025/01/31 12:00:00", 1, "カリン", 3.414, 190801, 1000001, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 2, -416.5, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 2, 62, "2025/01/31 12:00:00", 1, "カリン", 3.099, 190801, 1000002, "ミッションをクリアして、\n報酬をゲットしましょう！", 2, -416.5, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 3, 63, "2025/01/31 12:00:00", 1, "カリン", 2.801, 190801, 1000003, "受け取ることができる\n報酬があるようです\n確認してみてください", 2, -416.5, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 2, 4, 63, "2025/01/31 12:00:00", 1, "カリン", 0.0, 190801, 1000004, "報酬がもらえますよ！\nチェックしてみてください", 2, -416.5, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 2, 5, 64, "2025/01/31 12:00:00", 1, "カリン", 2.12, 190801, 1000005, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, -363.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 6, 64, "2025/01/31 12:00:00", 1, "カリン", 1.68, 190801, 1000006, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 2, -363.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 2, 7, 64, "2025/01/31 12:00:00", 1, "カリン", 2.33, 190801, 1000007, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, -363.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 3, 101, 61, "2025/01/31 12:00:00", 10201, "ラビリスタ", 5.18, 133701, 1020101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 7, -285.0, -6.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 201, 61, "2025/01/31 12:00:00", 10201, "クリスティーナ", 8.77, 133901, 1020102, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 2, -285.0, -2.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 6, 301, 61, "2025/01/31 12:00:00", 10201, "ネネカ", 15.5, 133801, 1020103, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 1, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 2, 101, 61, "2025/02/28 12:00:00", 10202, "ランファ", 9.061, 134301, 1020201, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 5, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 201, 61, "2025/02/28 12:00:00", 10202, "チカ", 7.699, 134401, 1020202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 101, 61, "2025/03/31 12:00:00", 10203, "アオイ", 8.595, 134601, 1020301, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 201, 61, "2025/03/31 12:00:00", 10203, "クローチェ", 7.758, 134501, 1020302, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 2, 101, 61, "2025/04/30 12:00:00", 10204, "ルイズマリー", 7.0, 132302, 1020401, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 6, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 201, 61, "2025/04/30 12:00:00", 10204, "イロハ", 7.904, 132402, 1020402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 4, 301, 61, "2025/04/30 12:00:00", 10204, "ソノ", 8.487, 132502, 1020403, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 101, 61, "2025/05/31 12:00:00", 10205, "カノン", 8.763, 134901, 1020502, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 201, 61, "2025/05/31 12:00:00", 10205, "ツムギ", 6.417, 134801, 1020503, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 3, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 3, 101, 61, "2025/06/30 12:00:00", 10206, "エリス", 10.335, 135001, 1020601, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 7, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 2, 201, 61, "2025/06/30 12:00:00", 10206, "シェフィ", 6.281, 135101, 1020602, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 4, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 301, 61, "2025/06/30 12:00:00", 10206, "プレシア", 12.244, 135201, 1020603, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 2, 101, 61, "2025/07/31 12:00:00", 10207, "クリア", 6.339, 135301, 1020701, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 8, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 7, 201, 61, "2025/07/31 12:00:00", 10207, "アネモネ", 8.184, 135401, 1020702, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 9, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 9, 101, 61, "2025/08/31 12:00:00", 10208, "アイラ", 3.906, 129101, 1020801, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 201, 61, "2025/08/31 12:00:00", 10208, "シナツ", 14.465, 129201, 1020802, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 2, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 4, 301, 61, "2025/08/31 12:00:00", 10208, "ヒヨリ", 8.662, 100101, 1020803, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 3, -285.0, 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("2030/01/01 14:59:59", 1, 401, 61, "2025/08/31 12:00:00", 10208, "レイ", 10.915, 100301, 1020804, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 3, -285.0, 0.0);
